import React, { useState, useContext, useEffect } from 'react';
import styled from 'styled-components';
import { FilePlus } from 'react-bootstrap-icons';
import Preview from 'Templates/Simple/Preview'


import { Link, useHistory } from 'react-router-dom';
import { loginUser } from 'api'

const Wrapper = styled.div`
    background-color: #F6F6F2;
    align-items: center;
    justify-content: center;
    display: flex;
    height: 100vh;
`

const CvBoard = styled.div`
    width: 80%;
    background-color: white;
    padding: 32px;
`

const CardWrapper = styled.div`
    padding: 16px 0px;
    display: flex;
    flex-direction: row;
`

const Plus = styled(FilePlus)`
    width: 90px;
    height: auto;
`

const CvCard = styled.div`
    width: 270px;
    height: 400px;
    align-items: center;
    justify-content: center;
    display: flex;
    background-color: #C2EDCE;
    border-radius: 10px; 
    margin: 0px 12px;
`

export default () => {
    const [cvs, setCvs ] = useState([])
    const userState = {
        firstName: 'Karl',
        lastName: 'Jansson',
        email: 'Karljansson91@gmail.com',
        phone: '0760042337',
        title: 'FullstackUtvecklare',
        profile: 'Massa massa saker',
      }
    return (
        <Wrapper>
            <CvBoard>
                <h4>Dina CV</h4>
                <CardWrapper>
                    <CvCard>
                        <Plus fill={"white"}/>
                    </CvCard>
                    <CvCard>
                        <Preview userState={userState}/>
                    </CvCard>
                </CardWrapper>
            </CvBoard>
        </Wrapper>
    )
}
